import React, {Component, Fragment} from 'react';
import {Typography, Button} from '@material-ui/core';
import {Navigate} from '../App';
import Checkbox from '@material-ui/core/Checkbox';
import InputSlider from './InputSlider';

interface DailyCheckInProps {
    navigate: Navigate;
}

interface DailyCheckInState {
    page: number;
    water: number | null;
    exercise: number | null;
    feeling: number | null;
}


export class DailyCheckIn extends Component<
    DailyCheckInProps,
    DailyCheckInState
> {
    constructor(props: DailyCheckInProps) {
        super(props);
        this.state = {
            page: 1,
            water: null,
            exercise: null,
            feeling: null,
        };
    }


    render() {
        return (
            <Fragment>
                <div
                    style={{
                        display: 'flex',
                        flexDirection: 'row',
                        justifyContent: 'space-between',
                        padding: '2ch'
                    }}
                >
                    <Button onClick={() => this.props.navigate('HomeScreen')}>
                        Home
                    </Button>
                    <p>DailyCheckIn</p>
                </div>
                {this.getContent()}
                <div
                    style={{
                        display: 'flex',
                        flexDirection: 'row',
                        justifyContent: 'space-between',
                        padding: '2ch'
                    }}
                >
                    <Button
                        onClick={() =>
                            this.setState({page: this.state.page - 1})
                        }
                        disabled={this.state.page === 1}
                    >
                        Previous
                    </Button>
                    <Button
                        onClick={() =>
                            this.setState({page: this.state.page + 1})
                        }
                        disabled={this.state.page === 2}
                    >
                        Next
                    </Button>
                </div>
            </Fragment>
        );
    }

    getContent() {
        if (this.state.page === 1) {
            return this.page1();
        } else if (this.state.page === 2) {
            return this.page2();
        }
    }

    page1() {
        return (
            <Fragment>
                <div
                    style={{
                        display: 'flex',
                        flexDirection: 'column',
                        justifyContent: 'space-between',
                        padding: '2ch'
                    }}
                >
                    <h1>Nutrition Wellness</h1>
                    <div
                        style={{
                            display: 'flex',
                            flexDirection: 'row',
                            justifyContent: 'space-between',
                            padding: '2ch'
                        }}
                    >
                        <p>Water</p>
                        {[0, 1, 2, 3].map(water => (
                            <Checkbox
                                defaultChecked
                                color="default"
                                checked={this.state.water === water}
                                onChange={() => this.setState({ water })}
                            />
                        ))}
                    </div>
                    <h2>Food</h2>
                    <p>Vegetables</p>
                    <InputSlider/>
                    <p>Grains</p>
                    <InputSlider/>
                    <p>Protein</p>
                    <InputSlider/>
                </div>
            </Fragment>
        );
    }

    page2() {
        return (
            <Fragment>
                <div
                    style={{
                        display: 'flex',
                        flexDirection: 'column',
                        justifyContent: 'space-between',
                        padding: '2ch'
                    }}
                >
                    <h1>Physical Wellness</h1>
                    <div
                        style={{
                            display: 'flex',
                            flexDirection: 'row',
                            justifyContent: 'space-between',
                            padding: '2ch'
                        }}
                    >
                        <p>How are you feeling today?</p>
                        {[0, 1, 2, 3, 4].map(feeling => (
                            <Checkbox
                                defaultChecked
                                color="default"
                                checked={this.state.feeling === feeling}
                                onChange={() => this.setState({ feeling })}
                            />
                        ))}
                    </div>
                    <div
                        style={{
                        display: 'flex',
                        flexDirection: 'row',
                        justifyContent: 'space-between',
                        padding: '2ch'
                    }}
                        >
                        <p>How much exercise did you get today?</p>
                        {[0, 1, 2, 3].map(exercise => (
                            <Checkbox
                                defaultChecked
                                color="default"
                                checked={this.state.exercise === exercise}
                                onChange={() => this.setState({ exercise })}
                            />
                        ))}
                    </div>
                </div>
            </Fragment>
        );
    }
}
